from http.server import SimpleHTTPRequestHandler, ThreadingHTTPServer
import socket, os, threading
from pyautogui import hotkey

import tkinter as tk
import base64

PORT = 80

def ip_address_helper():
    try:
        host_name = socket.gethostname()
        host_ip = socket.gethostbyname(host_name)
        return host_ip
    except:
        return "Error! Unable to determine IP address."

class MyRequestHandler(SimpleHTTPRequestHandler):

    def do_POST(self):
        content_length = int(self.headers['Content-Length'])
        post_data = self.rfile.read(content_length).decode('utf-8')

        keys = [key.split('=')[1] for key in post_data.split('&')]

        if self.path == '/index.html':
            print(f"Sending keys: {'+'.join(str(k) for k in keys)}...", end=' ')
            hotkey(*keys)
            print("Done!")

        self.do_GET()

    def do_GET(self):
        if self.path == '/':
            self.send_index()
        elif self.path == '/index.html':
            self.send_index()
        else:
            super().do_GET()

    def send_index(self):
        if os.path.exists('index.html'):
            super().do_GET()
        else:
            self.encoded_html = index_html.encode('utf-8')
            self.send_response(200)
            self.send_header("Content-type", "text/html")
            self.send_header("Content-Length", len(self.encoded_html))
            self.end_headers()
            self.wfile.write(self.encoded_html)

class MyWindow:
    def __init__(self, master, ip_address):
        self.master = master
        master.title("ZoomRemote")
        master.configure(bg="white")

        self.url_image = tk.PhotoImage(data=url_image)
        self.help_image = tk.PhotoImage(data=help_image)

        self.url_label = tk.Label(
            self.master,
            image=self.url_image,
            text=ip_address,
            font=(None, 15),
            bg='white',
            compound=tk.CENTER,
        ).pack()
        self.help_label = tk.Label(
            self.master, image=self.help_image, bg='white',).pack()


def main():
    print(f"Starting HTTP server on port {PORT}...", end=' ')

    with ThreadingHTTPServer(("", PORT), MyRequestHandler) as httpd:
        print("Done!")
        print(ip_address_helper())

        server_thread = threading.Thread(target=httpd.serve_forever, daemon=True)
        server_thread.start()

        root = tk.Tk()
        my_window = MyWindow(root, ip_address_helper())
        window_icon = tk.PhotoImage(data=icon_image)
        root.tk.call('wm', 'iconphoto', root._w, window_icon)
        root.resizable(False, False)
        root.mainloop()

